import React from "react";

const Display = () => {
  return (
    <div id="ul">
      <h3>Topic 2</h3>
      <ul>
        <li>username</li>
        <li>2 hours ago</li>
        <li>comments</li>
      </ul>
    </div>
  );
};

export default Display;
